import { Routes,Route } from 'react-router-dom';
import './App.css';
import BingoPage from './Pages/BingoPage';

function App() {
  return (
    <div className="App">
    <h1>Bingo App</h1>
    <Routes>
      <Route path="/game" element={<BingoPage/>} />
    </Routes>
    </div>
  );
}

export default App;
